import "./App.css";
import React from "react";
import { BrowserRouter } from "react-router-dom";
import { Navbar } from "./Components/Navbar/Navbar";
import { WelcomePage } from "./Components/Welcome/Welcome";
import BoatAnimation from "./Components/BoatAnimation/BoatAnimation";
function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <React.Fragment>
          <Navbar />
          <WelcomePage />
        </React.Fragment>
      </BrowserRouter>
    </div>
  );
}

export default App;
